import React, {useState, useEffect} from "react"
import { Link } from "react-router-dom";
import leaderboard from "./leaderboard.json";


export default function Leaderboard(){

    return(
        <>
            <div className="table">
                <ul className="leaderboard">
                    <li>Username - <span className="color-grandmaster">Grandmaster</span> [<span className="color-blue">4200</span>]</li>
                    <li>Test - <span className="color-master">Master</span> [<span className="color-blue">3600</span>]</li>
                    <li>Test2 - <span className="color-diamond">Diamond</span> [<span className="color-blue">3000</span>]</li>
                    <li>Test3 - <span className="color-platinum">Platinum</span> [<span className="color-blue">2700</span>]</li>
                    <li>Test4 - <span className="color-gold">Gold</span> [<span className="color-blue">2200</span>]</li>
                    <li>Test5 - <span className="color-silver">Silver</span> [<span className="color-blue">1700</span>]</li>
                    <li>Test6 - <span className="color-bronze">Bronze</span> [<span className="color-blue">800</span>] </li>

                </ul>
                
            </div>
        </>
    )
}
